import React, { Component } from 'react';
import Head from '../components/Head';
import axios from 'axios';

export default class Classes extends Component {


	constructor(props) {
		super(props);
		this.state = {
			students: []
		}
		axios.get(`/classes`)
			.then(res => {
				this.setState({ students: res.data });
			}).catch(error => {
				console.log(error);
			});
		this.handleChange = this.handleChange.bind(this);

	}

	handleChange(event) {
		this.setState({
			[event.target.name]: event.target.value
		});
	}

	render() {
		return (
			<div>
				<Head />
				<div id="body">
					<table>
						<thead>
							<tr>
								<td>name</td>
								<td>password</td>
								<td>class</td>
							</tr>
						</thead>
						<tbody>
							{this.state.students.map((stud)=><tr  key={stud.id}>
								<td contenteditable="true" onChange={this.handleChange}>{stud.name}</td>
								<td contenteditable="true" onChange={this.handleChange}>{stud.password}</td>
								<td contenteditable="true"onChange={this.handleChange}>{stud.class}</td>
							</tr>)}
							</tbody>
					</table>
				</div>
			</div>
		);
	}
}
